import "./repos.css";
import Repos from "./Repos";

export default function Repolist() {
    return (
        <div className="repo-main">
            <h1>Personal Projects</h1>
            <h4>This list is auto-populated from my public GitHub repos.</h4>
            <div className="repo-container">
                <Repos />

            </div>
        </div>
    )
}
